import React from 'react';
import logo from '../assets/logos/Scotiabank-Workmark-Logo_HEX_E.png';
class Navbar extends React.Component {


    render() {
        return (
            <nav className="navbar">
                <a className="navbar-brand" href="/">
                    <img src="../assets/logos/Scotiabank-Workmark-Logo_HEX_E.png" alt=""></img>
                </a>

            </nav>
        );
    }

};

export default Navbar;
